import React from 'react';
import { useNavigate } from 'react-router-dom';
import basestyle from "../../css/Base.module.css";
import welcomestyle from "./Welcome.module.css";

const Welcome = ({ setUserState }) => {
  const navigate = useNavigate();

  const logout = () => {
    setUserState({});
    localStorage.removeItem("token");
    navigate("/login", { replace: true });
  };

  return (
    <div className={welcomestyle.welcome}>
      <h1>Welcome</h1>
      <p>Welcome to the application!</p>
      <button className={`${basestyle.button_common} ${welcomestyle.logoutButton}`} onClick={logout}>
        Logout
      </button>
    </div>
  );
};

export default Welcome;
